    <View style={styles.container2}>
      <StatusBar backgroundColor={BGColor}/>
        <Animated.View>
          <Image />
        </Animated.View>
    </View>
    );
}

const styles = StyleSheet.create({
    container2: {
      position: 'absolute',
      backgroundColor: BGColor,
      top: 0,
